import React from "react";

export const renderHarry = (playerY: number, beams: any[], PLAYER_W: number, PLAYER_H: number) => {
  const centerX = 30 + PLAYER_W/2, centerY = playerY + PLAYER_H/2;
  return (
    <g>
      <ellipse cx={centerX} cy={playerY + PLAYER_H - 8} rx={PLAYER_W/2 + 4} ry={3} fill="#8B4513" />
      <rect x={centerX - 2} y={playerY + PLAYER_H - 12} width={4} height={8} fill="#654321" />
      <rect x={centerX - 1} y={playerY + PLAYER_H - 16} width={2} height={6} fill="#8B4513" />
      <circle cx={centerX} cy={playerY + 18} r={18} fill="#F4C2A1" stroke="#D4A574" strokeWidth={2} />
      <ellipse cx={centerX - 6} cy={playerY + 18} rx={7} ry={7} stroke="#2C2C2C" strokeWidth={2.5} fill="none" />
      <ellipse cx={centerX + 6} cy={playerY + 18} rx={7} ry={7} stroke="#2C2C2C" strokeWidth={2.5} fill="none" />
      <line x1={centerX - 1} y1={playerY + 18} x2={centerX + 1} y2={playerY + 18} stroke="#2C2C2C" strokeWidth={2} />
      <circle cx={centerX - 6} cy={playerY + 18} r={2} fill="#2C2C2C" />
      <circle cx={centerX + 6} cy={playerY + 18} r={2} fill="#2C2C2C" />
      <circle cx={centerX - 5} cy={playerY + 17} r={0.8} fill="white" />
      <circle cx={centerX + 7} cy={playerY + 17} r={0.8} fill="white" />
      <ellipse cx={centerX} cy={playerY + 22} rx={1.5} ry={2} fill="#E6B89C" />
      <path d={`M ${centerX - 3} ${playerY + 26} Q ${centerX} ${playerY + 28} ${centerX + 3} ${playerY + 26}`} stroke="#2C2C2C" strokeWidth={1.5} fill="none" />
      <polyline points={`${centerX - 4},${playerY + 8} ${centerX - 1},${playerY + 12} ${centerX + 1},${playerY + 10} ${centerX + 4},${playerY + 14}`} stroke="#FFD700" strokeWidth={2.5} fill="none" />
      <rect x={30 + 8} y={playerY + 36} width={PLAYER_W - 16} height={12} fill="#7F0000" rx={6} />
      <rect x={30 + 10} y={playerY + 38} width={PLAYER_W - 20} height={8} fill="#FFD700" rx={4} />
      <rect x={30 + PLAYER_W - 2} y={playerY + PLAYER_H/2 - 1} width={20} height={2} fill="#8B4513" rx={1} />
      <circle cx={30 + PLAYER_W + 18} cy={playerY + PLAYER_H/2} r={1.5} fill="#FFD700" />
      {beams.some(b => b.active) && <circle cx={30 + PLAYER_W + 22} cy={playerY + PLAYER_H/2} r={1.2} fill="#FFD700" opacity={0.7} />}
    </g>
  );
};

export const renderObstacle = (o: any, OBSTACLE_W: number, OBSTACLE_GAP: number, GAME_HEIGHT: number) => (
  <g key={o.id}>
    <rect x={o.x} y={0} width={OBSTACLE_W} height={o.height} fill="#b8c2ff" />
    <rect x={o.x} y={o.height + OBSTACLE_GAP} width={OBSTACLE_W} height={GAME_HEIGHT - o.height - OBSTACLE_GAP} fill="#b8c2ff" />
  </g>
);

export const renderEnemy = (e: any, ENEMY_W: number, ENEMY_H: number) => {
  const centerX = e.x + ENEMY_W / 2, centerY = e.y + ENEMY_H / 2;
  return (
    <g key={e.id}>
      {/* Frankenstein Monster Body */}
      <ellipse cx={centerX} cy={centerY + 8} rx={ENEMY_W/2 - 3} ry={ENEMY_H/2 - 4} fill="#4a5d23" stroke="#2d3a15" strokeWidth={2} />

      {/* Head */}
      <ellipse cx={centerX} cy={e.y + 8} rx={ENEMY_W/2 - 2} ry={ENEMY_H/3 - 2} fill="#8b7355" stroke="#5d4e37" strokeWidth={1.5} />

      {/* Hair */}
      <path d={`M ${e.x + 2} ${e.y + 6} Q ${centerX} ${e.y + 2} ${e.x + ENEMY_W - 2} ${e.y + 6}`} fill="#2d1810" stroke="#1a0f08" strokeWidth={1} />

      {/* Scars/Stitches */}
      <line x1={e.x + 4} y1={e.y + 10} x2={e.x + 8} y2={e.y + 12} stroke="#654321" strokeWidth={1.5} />
      <line x1={e.x + ENEMY_W - 8} y1={e.y + 10} x2={e.x + ENEMY_W - 4} y2={e.y + 12} stroke="#654321" strokeWidth={1.5} />
      <line x1={e.x + 6} y1={e.y + 14} x2={e.x + 10} y2={e.y + 16} stroke="#654321" strokeWidth={1} />

      {/* Eyes */}
      <circle cx={centerX - 4} cy={e.y + 10} r={1.5} fill="#ff0000" />
      <circle cx={centerX + 4} cy={e.y + 10} r={1.5} fill="#ff0000" />
      <circle cx={centerX - 4} cy={e.y + 10} r={0.5} fill="#ffffff" />
      <circle cx={centerX + 4} cy={e.y + 10} r={0.5} fill="#ffffff" />

      {/* Mouth */}
      <path d={`M ${centerX - 3} ${e.y + 16} Q ${centerX} ${e.y + 18} ${centerX + 3} ${e.y + 16}`} stroke="#2d1810" strokeWidth={1.5} fill="none" />

      {/* Arms */}
      <ellipse cx={e.x - 2} cy={centerY + 4} rx={3} ry={ENEMY_H/4} fill="#8b7355" stroke="#5d4e37" strokeWidth={1} />
      <ellipse cx={e.x + ENEMY_W + 2} cy={centerY + 4} rx={3} ry={ENEMY_H/4} fill="#8b7355" stroke="#5d4e37" strokeWidth={1} />

      {/* Legs */}
      <ellipse cx={e.x + 4} cy={e.y + ENEMY_H - 2} rx={2} ry={4} fill="#4a5d23" stroke="#2d3a15" strokeWidth={1} />
      <ellipse cx={e.x + ENEMY_W - 4} cy={e.y + ENEMY_H - 2} rx={2} ry={4} fill="#4a5d23" stroke="#2d3a15" strokeWidth={1} />

      {/* Name label */}
      <text x={centerX} y={e.y - 6} fontSize="8" fill="#fff" textAnchor="middle" stroke="black" strokeWidth={0.5} fontWeight="bold">{e.type}</text>

      {/* Glowing effect */}
      <ellipse cx={centerX} cy={centerY + 8} rx={ENEMY_W/2 + 2} ry={ENEMY_H/2 + 2} fill={e.color} opacity={0.2} />
    </g>
  );
};

export const renderBeams = (beams: any[]) =>
  beams.filter(b => b.active).map((b, i) => (
    <g key={i}>
      {/* Magical beam core */}
      <rect x={b.x} y={b.y} width={24} height={6} fill="#ffd700" rx={3} />
      {/* Beam glow effect */}
      <rect x={b.x - 1} y={b.y - 1} width={26} height={8} fill="#ffff00" opacity={0.4} rx={4} />
      {/* Magical sparkles */}
      <circle cx={b.x + 6} cy={b.y + 3} r={1} fill="#ffffff" opacity={0.8} />
      <circle cx={b.x + 12} cy={b.y + 2} r={0.8} fill="#ffffff" opacity={0.6} />
      <circle cx={b.x + 18} cy={b.y + 4} r={0.6} fill="#ffffff" opacity={0.7} />
      {/* Energy particles */}
      <circle cx={b.x + 3} cy={b.y + 1} r={0.5} fill="#ff69b4" opacity={0.6} />
      <circle cx={b.x + 15} cy={b.y + 5} r={0.4} fill="#87ceeb" opacity={0.5} />
      <circle cx={b.x + 21} cy={b.y + 1} r={0.3} fill="#98fb98" opacity={0.7} />
    </g>
  ));

export const renderPotion = (p: { x: number, y: number, id: number }, POTION_W: number, POTION_H: number) => {
  const centerX = p.x + POTION_W/2;
  const centerY = p.y + POTION_H/2;

  return (
    <g key={p.id}>
      {/* Glass bottle outline */}
      <ellipse cx={centerX} cy={centerY + 2} rx={POTION_W/2 - 1} ry={POTION_H/2 - 1} fill="none" stroke="#e8f4f8" strokeWidth={2} />

      {/* Glass bottle body */}
      <ellipse cx={centerX} cy={centerY + 2} rx={POTION_W/2 - 2} ry={POTION_H/2 - 2} fill="#f0f8ff" opacity={0.3} />

      {/* Magical liquid with gradient effect */}
      <ellipse cx={centerX} cy={centerY + 6} rx={POTION_W/2 - 4} ry={POTION_H/2 - 6} fill="#00ff88" opacity={0.8} />
      <ellipse cx={centerX} cy={centerY + 4} rx={POTION_W/2 - 5} ry={POTION_H/2 - 8} fill="#88ffaa" opacity={0.6} />
      <ellipse cx={centerX} cy={centerY + 2} rx={POTION_W/2 - 6} ry={POTION_H/2 - 10} fill="#aaffcc" opacity={0.4} />

      {/* Liquid surface with meniscus */}
      <path d={`M ${p.x + 4} ${p.y + 8} Q ${centerX} ${p.y + 6} ${p.x + POTION_W - 4} ${p.y + 8}`} fill="#00ff88" opacity={0.9} />

      {/* Glass highlights */}
      <ellipse cx={centerX - 2} cy={centerY - 2} rx={2} ry={POTION_H/3} fill="#ffffff" opacity={0.6} />
      <ellipse cx={centerX + 1} cy={centerY + 1} rx={1} ry={POTION_H/4} fill="#ffffff" opacity={0.4} />

      {/* Cork stopper */}
      <rect x={centerX - 6} y={p.y - 8} width={12} height={10} fill="#8b4513" rx={2} />
      <rect x={centerX - 5} y={p.y - 7} width={10} height={8} fill="#a0522d" rx={1} />

      {/* Cork texture lines */}
      <line x1={centerX - 4} y1={p.y - 6} x2={centerX + 4} y2={p.y - 6} stroke="#654321" strokeWidth={0.5} />
      <line x1={centerX - 4} y1={p.y - 4} x2={centerX + 4} y2={p.y - 4} stroke="#654321" strokeWidth={0.5} />
      <line x1={centerX - 4} y1={p.y - 2} x2={centerX + 4} y2={p.y - 2} stroke="#654321" strokeWidth={0.5} />

      {/* Magical sparkles and bubbles */}
      <circle cx={centerX + 3} cy={centerY - 3} r={1} fill="#ffffff" opacity={0.9} />
      <circle cx={centerX - 2} cy={centerY + 1} r={0.8} fill="#ffffff" opacity={0.7} />
      <circle cx={centerX + 1} cy={centerY + 4} r={0.6} fill="#ffffff" opacity={0.8} />
      <circle cx={centerX - 1} cy={centerY + 6} r={0.5} fill="#ffffff" opacity={0.6} />

      {/* Magical glow effect */}
      <ellipse cx={centerX} cy={centerY + 2} rx={POTION_W/2 + 3} ry={POTION_H/2 + 3} fill="#00ff88" opacity={0.15} />

      {/* Floating magical particles */}
      <circle cx={centerX + 8} cy={p.y - 5} r={1.5} fill="#ffd700" opacity={0.8} />
      <circle cx={centerX - 6} cy={p.y - 2} r={1} fill="#ff69b4" opacity={0.7} />
      <circle cx={centerX + 6} cy={p.y + 2} r={0.8} fill="#87ceeb" opacity={0.6} />

      {/* Potion label */}
      <rect x={centerX - 8} y={centerY - 2} width={16} height={4} fill="#ffffff" opacity={0.8} rx={1} />
      <text x={centerX} y={centerY + 1} fontSize="6" fill="#000" textAnchor="middle" fontWeight="bold">MAGIC</text>
    </g>
  );
};
